package dtofactory

import (
	"bytes"
	"encoding/base64"
	"encoding/gob"
	"fmt"
	"github.com/turbonomic/kubeturbo/pkg/discovery/task"
	"io/ioutil"
	api "k8s.io/api/core/v1"
	"os"
	"strings"
)

var cannedTopology []string

// go binary encoder
func ToBin64(m *api.Pod) string {
	b := bytes.Buffer{}
	e := gob.NewEncoder(&b)
	err := e.Encode(m)
	if err != nil {
		fmt.Println(`failed gob Encode`, err)
	}
	return base64.StdEncoding.EncodeToString(b.Bytes())
}

// go binary decoder
func FromBin64(str string) *api.Pod {
	m := api.Pod{}
	by, _ := base64.StdEncoding.DecodeString(str)
	b := bytes.Buffer{}
	b.Write(by)
	d := gob.NewDecoder(&b)
	d.Decode(&m)
	return &m
}

func DumpTopology(currTask *task.Task, path string) {
	// Create the output file
	if fd, err := os.Create(path); err == nil {
		defer fd.Close()
		for _, pod := range currTask.PodList() {
			b := ToBin64(pod)
			fd.WriteString(b)
			fd.WriteString("\n")
		}
	}
}

func LoadTopologyFromFile(path string) ([]*api.Pod, error) {
	pods := make([]*api.Pod, 0, 10)
	data, err := ioutil.ReadFile(path)
	if err != nil {
		return nil, err
	}
	lines := strings.Split(string(data), "\n")
	for _, line := range lines {
		if len(line) == 0 {
			break
		}
		pod := FromBin64(line)
		pods = append(pods, pod)
	}
	return pods, nil
}

func LoadCannedTopology() ([]*api.Pod, error) {
	pods := make([]*api.Pod, 0, 10)
	for _, line := range cannedTopology {
		pod := FromBin64(line)
		pods = append(pods, pod)
	}
	return pods, nil
}

func init() {
	gob.Register(api.Pod{})
	gob.Register(api.Container{})
	/*
	 * The following pods are in the canned topology:
	 *
	 * Pod 0: controllable = true, monitored = true, parentKind = ReplicationController
	 * Pod 1: controllable = false, monitored = true, parentKind = DaemonSet
	 * Pod 2: controllable = true, monitored = true, parentKind = ReplicaSet
	 * Pod 3: controllable = true, monitored = false, parentKind = ReplicaSet
	 */
	cannedTopology = []string{
		"",
		"",
		"",
		"",
	}
}
